description:
Courtney is working in her office when Tyler comes in amazed that after just a short time working for the company he is getting a office. Apparently, no one gave Courtney the memo and she lets him know that his stay in the room isn't going to be very long. Courtney starts going through the box he brought until she finds a frame without a picture in it. She questions Tyler on what happened to the picture and he reluctantly tells her that it was his old girlfriend. She finds out that he's now single and that there may be a reason they can co-exist in the same office. She locks the door and lets him know that he is a visitor in her office and his first duty is to get down on his knees and eat her pussy!


